          const  state5 = await OrderState.findOne({ where: { orderStateID: 5 } })
            if (state5 == null) await OrderState.create({ orderStateID: 5, orderStateName: 'Đã Hủy' })

          const  state6 = await OrderState.findOne({ where: { orderStateID: 6 } })
